The Flintstones: The Rescue of Dino & Hoppy (NES)

Eu só fui poder ter o NES há pouco tempo, então ainda tem muitos jogos que estou jogando de verdade pela primeira vez!
Eu amava o desenho dos Flintstones quando era criança, era um dos meus desenhos favoritos! ☺️
Esse jogo dos Flintstones foi lançado em 1991, é muito divertido, bonitinho e ele tem uma particularidade no gameplay: pro Fred conseguir subir numa plataforma é preciso segurar o botão de pular. 🤓 Isso eu vi em poucos jogos até agora, mas de certa forma me desbloqueou uma memória da época!
Pra um jogo de NES os sprites são bem fiéis ao desenho! 

🇺🇸 
I've only been able to get a NES recently, so there are still a lot of games I'm actually able to play for the first time!
I love the Flintstones cartoon when I was a kid, it was one of my favorite cartoons at all!
This Flintstones game was released in 1991, it's very fun, cute and it has a particularity in the gameplay: for Fred to be able to climb on a platform, you have to hold the jump button. 🤓 This I've seen in a few games so far, but it somehow unlocked a memory of the time!
For a NES game the sprites are very faithful to the cartoon! 

